import React from 'react';
import {
    View, Text
} from 'react-native';

const Notification = () => {
    return (
        <View style={{
            flex: 1,
            alignItems: 'center',
            justifyContent: 'center'
        }}>
        <Text>Notification</Text>
        </View>
    )
}

export default Notification;
